Caption: I think I'm just really stressed out lately producing so much new stuff and trying to get it all paid for and trying to get it all out to the customers on time. It's normal, just like the last time I did a big production run...but bigger.  I think the stress is making me more sensitive than usual and being a person who isn't very good at expressing or embracing emotions other than happy...I'm trying to not just bury it down deep this time or run away from it. I'm trying to acknowledge that it's normal and trying to allow myself to feel.  Have you ever felt like all your friends were invited to an exclusive party and you were purposefully not invited?  Left out.  This is not literal but I keep feeling this way.  Maybe it's my mind wondering if I'm good enough? Maybe in these moments of intensity I start to fear failure. Maybe the fear of failure makes me feel unwanted and unwelcome? I suppose that's why some people need a security blanket and to exist within a comfort zone.  That will never be me so I guess I just need to start dealing with these emotion thingsğŸ˜­.
